import React from 'react';
import './index.css';

const Paginate = ({bookList, pageNumber}) => {
    console.log('paginate - ', Math.ceil(bookList.length/3))
    let pageIndex = [];
    for (let page=1; page <= Math.ceil(bookList.length/3); page++) {
        pageIndex.push(page);
    }
    console.log('checking', pageIndex)
    return (
        <div className="paginate-container">
            {
                pageIndex.map((number) => {
                    number === pageNumber
                    ? <button className="page">{number}</button>
                    : <button className="page">{number}</button>
                })
            }
        </div>
    )
}

export default Paginate;
